import "./App.css";
import DoroTimer from "./component/DoroTimer";
import TimerSetup from "./component/TimerSetup";
import Header from "./component/"

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <header>CustomDoro</header>
      </header>
      <TimerSetup></TimerSetup>
      <DoroTimer></DoroTimer>
    </div>
  );
}

export default App;
